package com.csg.androidexam;

import android.support.v4.app.Fragment;
import android.support.v4.app.FragmentManager;
import android.support.v4.app.FragmentPagerAdapter;
import android.support.v4.view.ViewPager;
import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;

import java.util.ArrayList;
import java.util.List;

public class FirstExamActivity extends AppCompatActivity {

    private List<Fragment> mData = new ArrayList<>();

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_first_exam);

        List<Model> movieDataList = new ArrayList<>();
        movieDataList.add(new Model("data:image/jpeg;base64,", "Final Score"));
        movieDataList.add(new Model("data:image/jpeg;base64,", "Final Score"));
        movieDataList.add(new Model("data:image/jpeg;base64,", "Final Score"));
        movieDataList.add(new Model("data:image/jpeg;base64,", "Final Score"));
        movieDataList.add(new Model("data:image/jpeg;base64,", "Final Score"));

        // FragmentList   List  data  dataList model   . movie
        List<Fragment> movieFragmentList = new ArrayList<>();
        for (Model model : movieDataList) {
            MovieFirstFragment movieFirstFragment = MovieFirstFragment.newInstance(model);
            movieFragmentList.add(movieFirstFragment);
        }

        MyAdapter adapter = new MyAdapter(getSupportFragmentManager(), movieFragmentList);

        ViewPager viewPager = findViewById(R.id.pager);
        viewPager.setAdapter(adapter);

    }

    private static class MyAdapter extends FragmentPagerAdapter {
        private List<Fragment> mData;

        public MyAdapter(FragmentManager fm, List<Fragment> data) {
            super(fm);
            this.mData = data;
        }

        @Override
        public Fragment getItem(int i) {
            return mData.get(i);
        }

        @Override
        public int getCount() {
            return mData.size();
        }


    }


}
